To resolve the issue with the OMNIbusEventReader using a future-dated StateChange value, follow these steps:

### Manual Solution via GUI:
1. **Stop the EventReader**: Access the EventReader in the GUI and stop it.
2. **Edit the EventReader**: Open the EventReader for editing.
3. **Clear State**: Click the "Clear State" button to reset the StateChange value.
4. **Restart the EventReader**: Exit the editor and restart the EventReader.

### Command Line Solution:
If you prefer using the Command Line Interface, you can execute the following commands:

1. **Connect to the ObjectServer**:
   ```bash
   telnet [Hostname] [Port]
   ```

2. **Run the ClearState.sh script**:
   You can create a script named `ClearState.sh` that includes the following logic:
   ```bash
   ANN="AcquireStateChange"; 
   Log(2,ID+ANN); 
   Script="/opt/IBM/netcool/impact/bin/CheckState.sh"; 
   Parameter="password"; 
   JRExecAction(Script, Parameter, false, 30); 
   NumExecOutput=Length(ExecOutput); 
   Log(3,ID+ANN+": NumExecOutput: "+NumExecOutput); 

   If(NumExecOutput >= 1) 
   {  
      Log(ID+ANN+": CurrentStateChange: "+HumanStateChange+" is greater than CurrentTime: "+HumanCurrentTime); 
      Log(ID+ANN+": !!! Clearing EventReader State !!!"); 
      Script="/opt/IBM/netcool/impact/bin/ClearState.sh"; 
      Parameter="password"; 
      JRExecAction(Script, Parameter, false, 30); 
   }
   ```

3. **Execute the script**: Run the `ClearState.sh` script to stop the EventReader, clear the StateChange value, and restart it.

By following either of these methods, you should be able to reset the StateChange value and allow the EventReader to capture current events again.

